function verificaIdade(pessoa) {
    if (pessoa.idade !== undefined) {
        pessoa.maiorDeIdade = pessoa.idade >= 18;
    } else {
        pessoa.maiorDeIdade = false;
    }
    return pessoa
}

console.log(verificaIdade({}));
